const HeadingTitle=({title})=>{
   return(
    <div style={divStyle}>
        <h2 style={h2Style}>{title}</h2>
    </div>
   );
}

const divStyle = {
padding:"10px 30px",
backgroundColor:"#fff",
}
 
const h2Style = {
color:"#1926d2",
fontSize:"30px",
fontWeight:"500",
borderBottom:"1px solid #1926d2",
width:"max-content",
paddingBottom:"5px"
}
export default HeadingTitle;
